    false,nt"url": null,nt"notes": "These data show the locations of in-service
    and out-of-service submarine cables that are owned by members of NASCA and located
    in U.S. territorial waters. More information on the cables can be found in the "Source
    Info" under the Uses and Metadata link. Other cables may exist in U.S. waters that
    are owned by non-NASCA members; those may be found in the "NOAA Charted Submarine
    Cables" dataset. Cable locations within 100 meters of land were removed from the
    dataset at the request of NASCA. Data shown here are not available for download
    at the request of the owners. Additional information can be found at http://www.n-a-s-c-a.org/;
    those requiring more detailed submarine telecom cable charting information are requested
    to submit any requests for information to CableCharts@n-a-s-c-a.org.",nt"license_title":
